    function getColor(value, breaks, colors) {
      let color;
      let found = false;
      let i = 1;
      while (found == false) {
        if (value <= breaks[i]) {
          color = colors[i - 1];
          found = true;
        } else {
          i ++;
        }
      }
      return color ? color : 'lightgrey';
    }

    function getBreaks(vals) {
    	let len = vals.length;
    	let breaks = [
    		vals[0],
    		vals[Math.floor(len * 0.2)],
    		vals[Math.floor(len * 0.4)],
    		vals[Math.floor(len * 0.6)],
    		vals[Math.floor(len * 0.8)],
    		vals[len - 1]
    	];
    	return breaks;
    }

